import React,{Component} from 'react';

class Counter extends Component{
    constructor(){
        super()
        this.state={
            count:0
        }
    }
    increment(){
        this.setState(prevState=>({
            count:prevState.count+1
        }))
        console.log(this.state.count)
    }
    utoz(){
        this.increment()
        this.increment()
        this.increment()
        this.increment()
    }
    render(){
        return(
            <div>
                <h1>count - {this.state.count}</h1>
                <button onClick={()=>this.utoz()}>increment</button>
                <button onClick={()=>this.utoz()}>update to zero</button>
            </div>
        )
    }
}

export default Counter;
